message:
O Governo Federal e a Saúde:

Veja algumas ações para este setor:

*Saúde no pré-pandemia*

. Criação da Secretaria de Atenção Primária à Saúde;
. Criação do Departamento de Saúde da Família;
. Criação do Programa Saúde na Hora;
. Criação do Programa Médicos pelo Brasil, com 18 mil vagas para médicos em municípios do interior;

. Criação do Conecte SUS, que possibilita que os cidadãos consultem sua trajetória no SUS, quais vacinas tomaram, atendimentos e exames realizados, de forma 100% Digital;
. Movimento Vacina Brasil, campanha de conscientização sobre a vacinação lançada em
2019;

. 99,6% de cobertura da vacina Tríplice Viral na população de 1 ano de idade;
. Mais de 1.000 ambulâncias do SAMU entregues para estados e municípios – investimento de quase R$ 200 milhões;
. Finalização de obras inacabadas: autorização junto ao TCU para que as obras de UPAs paralisadas se tornassem outras unidades de saúde, como UBS e Clínicas da Família;
. R$ 333 milhões para contratação de profissionais
. Aumento de 39% dos leitos de UTI já em 2019, com a abertura de 1.424 novos leitos;
. 100% dos pedidos de abertura de leitos pelos Estados atendidos em 2019, antes mesmo da pandemia.

*Pandemia*

EM 2020 E 2021:
. R$ 1 trilhão investidos no combate ao vírus;
. R$ 626,51 bilhões em gastos exclusivos para combate à Covid-19;
. R$ 375 bilhões em repasses gerais para estados e municípios;
. 8,8% do PIB usado no combate à Covid-19, mais que a média de todos países emergentes;
. R$ 28 bilhões para aquisição de vacinas contra a Covid-19;
. 600 milhões de doses contratadas;
. 465 milhões de doses já distribuídas a estados e municípios.

*Plano de ação*

. Em 2020, o Governo Federal decretou estado de emergência antes da OMS, publicou o Plano de Contingência contra o vírus antes que ele se espalhasse pelo País e não feriu a liberdade nem a dignidade de nenhum trabalhador;
. O Ministério da Saúde já participava de estudos da vacina contra Covid-19 em abril de 2020;
. 600 milhões de doses de vacina contratadas e 476 milhões já entregues a estados e municípios, dando a todos a liberdade de escolha por se vacinar;
. R$ 1 trilhão investidos no combate ao vírus e R$ 375 bilhões destinados a repasses gerais para estados e municípios;
. 8,8% do PIB usado no combate à Covid-19, mais que a média de todos países emergentes;
. 19,5 mil leitos de UTI para combate à Covid-19 (investimento de R$ 14,2 bilhões);
. R$ 21,5 bilhões em insumos;
. 1,4 mil profissionais contratados e disponibilizados aos estados;
. R$ 626,51 bilhões em gastos extraordinários para o combater a Covid;
. Marco do Saneamento: aumento de 1.000% nos investimentos privados em um dos setores mais deficitários da história do Brasil, um dos principais causadores de problemas de saúde na população;

. Mais cuidados a mulheres e crianças: instituição da nova Rede de Atenção Materna e Infantil (Rami) do SUS, lançamento do Cuida Mais Brasil e do Programa Mães do Brasil;
. Repasse de R$ 236 BILHÕES para ações voltadas às mulheres em 2021

*Saúde Indígena*

. Projeto SESAI Mais Saúde Indígena apóia atenção primária e especializada para indígenas que residem em áreas de difícil acesso;
. Entre os dias 2 e 6 de maio de 2021, foram 377 atendimentos clínicos em crianças, idosos e pacientes crônicos, além de 125 exames de ultrassom;
. No período de 2020 a jul/2022, foi destinado à saúde indígena o montante total de R$ 106.482.077,00 para enfrentamento da COVID-19. Esse orçamento compreende as despesas para aquisições de EPI, materiais de limpeza e insumos necessários, contratação de profissionais (médicos, enfermeiros e técnicos de enfermagem) e também apoio logístico e ampliação do atendimento aos povos indígenas;
. 90% na taxa de vacinação contra Covid-19 ainda em 2021;
. R$ 18 milhões para a autossuficiência nas aldeias em ações de etnodesenvolvimento e produção sustentável entre 2020 e 2021;
. R$ 17,2 milhões para proteção territorial, impedindo a entrada ilícita de não indígenas com mais de 500 ações de fiscalização durante a crise de Covid; ⬇️
